import React, { Component } from "react";
import Card from "pnnl-react-core/lib/Card";
import Grid from "react-bootstrap/es/Grid";
import Row from "react-bootstrap/es/Row";
import Col from "react-bootstrap/es/Col";
import CVGPlot from "../Plots/CVGPlot";
import LHSPlot from "../Plots/LHSPlot";
import LCSPlot from "../Plots/LCSPlot";
import Pdf from "react-to-pdf";
const ref = React.createRef();
const options = {
  orientation: "landscape",
  unit: "px",
  format: [1080, 1080]
};

export class Intermediate extends Component {
  constructor(props) {
    super(props);
    this.tm30 = this.props.tm30; //The data from the JSON file
    this.input = this.props.input;
  }
  holder(num) {
    return { height: num };
  }
  render() {
    return (
      <Grid>
        <div
          style={{
            width: "125%",
            marginLeft: "-15%",
            padding: "50, 50, 50, 50"
          }}
        >
          <Card>
            <Row>
              <Col xs={12} md={7}>
                <CVGPlot
                  xtest={this.tm30.path_xtest}
                  ytest={this.tm30.path_ytest}
                  xref={this.tm30.path_xref}
                  yref={this.tm30.path_yref}
                  rf={this.tm30.rg}
                  rg={this.tm30.rf}
                  cct={this.tm30.CCT[0]}
                  duv={this.tm30.DUV[0]}
                ></CVGPlot>
              </Col>
              <Col xs={12} md={5}>
                <div style={this.holder(400)}>
                  <LCSPlot data={this.tm30.local_chroma_shift}></LCSPlot>
                </div>

                <div style={this.holder(400)}>
                  <LHSPlot data={this.tm30.local_hue_shift}></LHSPlot>
                </div>
              </Col>
            </Row>
          </Card>
        </div>
      </Grid>
    );
  }
}

export default Intermediate;
